import incrementAmount from './'

export const increment = () => {
    return {
        type: 'INCREMENT'
    };
};

export const decrement = () => {
    return {
        type: 'DECREMENT'
    };
};

export const incrementBy = () => {
    return {
        type: 'INCREMENTBY5',
        payload: {incrementAmount}
    };
};
